import React, { useState, useEffect } from "react";
import axios from "axios";
import UploadBox from "./components/UploadBox";

const BACKEND = "http://127.0.0.1:8000"; // Backend FastAPI URL

export default function App() {
  const [summary, setSummary] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");
  const [darkMode, setDarkMode] = useState(false);

  // Toggle dark mode CSS class on body
  useEffect(() => {
    if (darkMode) document.body.classList.add("dark-mode");
    else document.body.classList.remove("dark-mode");
  }, [darkMode]);

  const handleUpload = async (file) => {
    setError("");
    setLoading(true);
    setSummary(null);

    try {
      const formData = new FormData();
      formData.append("file", file);

      const res = await axios.post(`${BACKEND}/upload`, formData, {
        headers: { "Content-Type": "multipart/form-data" },
      });

      const data = res.data;
      if (data.download_url && data.download_url.startsWith("/")) {
        data.download_url = BACKEND + data.download_url;
      }
      setSummary(data);
    } catch (err) {
      console.error(err);
      setError(err?.response?.data?.detail || "Error processing file.");
    } finally {
      setLoading(false);
    }
  };

  // Compute simple insights from sample data
  const calculateInsights = (rows) => {
    if (!rows || rows.length === 0) return null;
    const firstRow = rows[0];
    const numericCols = Object.keys(firstRow).filter(
      (key) => typeof firstRow[key] === "number"
    );
    const firstNumCol = numericCols[0];
    let avg = null;
    if (firstNumCol) {
      const nums = rows.map((r) => r[firstNumCol]).filter((x) => typeof x === "number");
      avg = (nums.reduce((a, b) => a + b, 0) / nums.length).toFixed(2);
    }

    // Example "most common" text group
    const textCols = Object.keys(firstRow).filter((k) => typeof firstRow[k] === "string");
    let commonVal = "N/A";
    if (textCols.length > 0) {
      const freq = {};
      rows.forEach((r) => {
        const val = r[textCols[0]];
        if (val) freq[val] = (freq[val] || 0) + 1;
      });
      commonVal = Object.entries(freq).sort((a, b) => b[1] - a[1])[0]?.[0] || "N/A";
    }

    return { avg, commonVal };
  };

  const insights = summary?.sample_data ? calculateInsights(summary.sample_data) : null;

  return (
    <div
      style={{
        maxWidth: 900,
        margin: "40px auto",
        padding: "20px",
        fontFamily: "Arial",
        transition: "background 0.3s, color 0.3s",
      }}
      className={darkMode ? "dark" : ""}
    >
      {/* Dark Mode Toggle */}
      <div style={{ textAlign: "right", marginBottom: 10 }}>
        <button
          onClick={() => setDarkMode(!darkMode)}
          style={{
            padding: "6px 12px",
            background: darkMode ? "#f0f0f0" : "#333",
            color: darkMode ? "#000" : "#fff",
            border: "none",
            borderRadius: 6,
            cursor: "pointer",
          }}
        >
          {darkMode ? "‚òÄÔ∏è Light Mode" : "üåô Dark Mode"}
        </button>
      </div>

      <h1>üìä DataClean Analyzer</h1>
      <p>Upload a CSV or Excel file ‚Äî it‚Äôll clean, analyze, and summarize your data!</p>

      <UploadBox onUpload={handleUpload} loading={loading} />

      {/* Spinner */}
      {loading && (
        <div style={{ textAlign: "center", marginTop: 20 }}>
          <div
            style={{
              width: 40,
              height: 40,
              border: "5px solid #ccc",
              borderTop: "5px solid #007bff",
              borderRadius: "50%",
              animation: "spin 1s linear infinite",
              margin: "0 auto",
            }}
          ></div>
          <p style={{ color: "#888", marginTop: 10 }}>Processing file... please wait.</p>
        </div>
      )}

      {error && <p style={{ color: "red" }}>{error}</p>}

      {summary && (
        <div style={{ marginTop: 20 }}>
          <h2>üìã Summary</h2>
          <ul>
            <li><b>Total Rows:</b> {summary.total_rows ?? "N/A"}</li>
            <li><b>Cleaned Rows:</b> {summary.cleaned_rows ?? "N/A"}</li>
            <li><b>Missing Values:</b> {summary.missing_values ?? "N/A"}</li>
            <li><b>Rows Removed:</b> {summary.rows_removed_percent ?? "N/A"}</li>
            <li>
              <b>Columns:</b>{" "}
              {Array.isArray(summary.columns)
                ? summary.columns.join(", ")
                : "No columns found"}
            </li>
          </ul>

          {/* Insights */}
          {insights && (
            <div
              style={{
                marginTop: 20,
                padding: 15,
                borderRadius: 8,
                background: darkMode ? "#222" : "#f9f9f9",
              }}
            >
              <h3>üí° Data Insights</h3>
              <ul>
                <li>
                  Average of first numeric column: <b>{insights.avg ?? "N/A"}</b>
                </li>
                <li>
                  Most common text value: <b>{insights.commonVal ?? "N/A"}</b>
                </li>
                <li>
                  Missing Values: <b>{summary.missing_values}</b>
                </li>
              </ul>
            </div>
          )}

          <h3 style={{ marginTop: 20 }}>üìà Data Preview</h3>
          <div style={{ overflowX: "auto" }}>
            <table
              border="1"
              cellPadding="6"
              cellSpacing="0"
              style={{
                width: "100%",
                borderCollapse: "collapse",
                background: darkMode ? "#333" : "white",
                color: darkMode ? "#eee" : "#000",
              }}
            >
              {Array.isArray(summary.columns) && Array.isArray(summary.sample_data) ? (
                <>
                  <thead>
                    <tr>
                      {summary.columns.map((c) => (
                        <th key={c}>{c}</th>
                      ))}
                    </tr>
                  </thead>
                  <tbody>
                    {summary.sample_data.map((row, i) => (
                      <tr key={i}>
                        {summary.columns.map((c) => (
                          <td key={c}>{row[c] ?? ""}</td>
                        ))}
                      </tr>
                    ))}
                  </tbody>
                </>
              ) : (
                <tbody>
                  <tr>
                    <td colSpan="100%">No data to display</td>
                  </tr>
                </tbody>
              )}
            </table>
          </div>

          {summary.download_url && (
            <div style={{ marginTop: 15 }}>
              <a href={summary.download_url} target="_blank" rel="noreferrer">
                <button
                  style={{
                    padding: "8px 12px",
                    cursor: "pointer",
                    background: darkMode ? "#007bff" : "#4CAF50",
                    color: "white",
                    border: "none",
                    borderRadius: 6,
                  }}
                >
                  Download Cleaned CSV
                </button>
              </a>
            </div>
          )}
        </div>
      )}

      {/* Spinner animation CSS */}
      <style>{`
        @keyframes spin {
          0% { transform: rotate(0deg); }
          100% { transform: rotate(360deg); }
        }
        body.dark-mode {
          background-color: #121212;
          color: #eee;
        }
      `}</style>
    </div>
  );
}
